Defendant Christopher S Jennings in court with attorney Carl William Chesshir.  Barbara A. Michaels appeared for the State of Wisconsin.
Defendant entered a plea of guilty to count 2. Court conducted plea colloquy with defendant. Court found defendant guilty.
Counts 1, 3, 4, and 5 dismissed and read-in.  

The Defendant was sentenced to the following:

IMPOSED AND STAYED SENTENCE OF:   

5 YEARS IMPRISONMENT (CREDIT - 2 days)
  -  2 YEAR(S) OF INITIAL CONFINEMENT
  -  3 YEAR(S) OF EXTENDED SUPERVISION;

TERM OF PROBATION:  4 YEARS;

CONDITIONS OF PROBATION:  
*AODA Assessment and follow through with any treatment recommended;
*Absolute Sobriety;  Random U.A.'s ; 
*No Use or Possession of alcohol, controlled substances or drug paraphernalia.
*No Use or Possession of prescription drugs without a valid prescription;
*Any valid prescription drugs must be taken only in the manner in which they are prescribed.
*Inform Agent of all prescriptions, prescriptions must be verified through agent and must be filled at one pharmacy. 
*Follow through with any treatment and/or counseling recommended by Agent;
*Maintain employment and/or combination of schooling; 
*No contact with:   co-actor, Sabrina Talley.
*Defendant is not to operate a motor vehicle unless properly licensed.
*DNA sample to be provided if not yet previously done.


RESTITUTION:  $420.00 to Waukesha County Mertro Drug Unit for buy money to be paid within the first year of probation as a condition of probation - restitution to be paid before costs or fines;

COURT COSTS:  $268.00 to be paid within the first year of probation as a condition of probation;

DNA SURCHARGE:  $250.00 to be paid as a condition of probation;

CONDITION TIME: 125 days Huber (non-working hours) commencing  October 2, 2015 by 7 p.m.  Defendant to serve the first 45 days and balance to be stayed and used at agents discretion. Sentence may be served in Milwaukee County.  

Probation may be served through Milwaukee County. 

IF REVOKED:
Defendant is not eligible for Challenge Incarceration Program.
Defendant is eligible for Substance Abuse Program.

$2000.00 cash bond previously posted to be returned to poster.  

Felony warnings, voting rights and firearms warnings given.
